// 从 xml 加载视图，页面加载约2.4秒
import React, { useCallback } from 'react';

const mx = require('mxgraph')({
    mxBasePath: 'mxgraph'
});

const { mxGraph, mxUtils, mxCodec, mxConstants, mxEdgeStyle, mxGraphModel, mxGeometry } = mx;


// mxCodec.decode 方法中需要注册这几个
window['mxGraphModel'] = mxGraphModel;
window['mxGeometry'] = mxGeometry;

function LargeDiagramImport() {
    let graph = null;
    const containerRef = useCallback(container => {
        if (container === null)
            return;

        graph = new mxGraph(container);
        graph.centerZoom = false;
        graph.setTooltips(false);
        graph.setEnabled(false);

        // Changes the default style for edges "in-place"
        var style = graph.getStylesheet().getDefaultEdgeStyle();
        style[mxConstants.STYLE_EDGE] = mxEdgeStyle.ElbowConnector;

        // Enables panning with left mouse button
        graph.panningHandler.useLeftButtonForPanning = true;
        graph.panningHandler.ignoreCell = true;
        graph.container.style.cursor = 'move';
        graph.setPanning(true);
        graph.border = 20;

    }, []);

    function load() {
        var xmlDocument = mxUtils.parseXml(savedXml);
        var decoder = new mxCodec(xmlDocument);
        var node = xmlDocument.documentElement;
        decoder.decode(node, graph.getModel());
        graph.resizeContainer = false;
    }

    return (
        <div style={{ height: "400px", width: "400px", borderStyle: "groove" }}>
            <h3>Large diagram import</h3>
            <button onClick={load}>load</button>
            <div ref={containerRef} className="canvas" style={{ height: "400px", width: "400px" }} />
        </div>
    );
}

export default LargeDiagramImport;

